import './App.css';

function App() {
  const categories = [
    {
      id: 1,
      name: 'Hats'
    },
    {
      id: 2,
      name: 'Hats'
    },
    {
      id: 3,
      name: 'Hats'
    },
    {
      id: 4,
      name: 'Hats'
    }
  ]

  return (
    <div className="App">
      <div className="categories-container">
        {
          categories.map((category) => {
            return (
              <div className="category-container" key={category.id}>
                <h1>{category.name}</h1>
                <p>Shop now</p>
              </div>
            )
          })
        }
      </div>
    </div>

  );
}

export default App;
